// src/App.jsx
import React, { useState, useEffect } from 'react';
import Grid from './Grid';

export default function App() {
  const [grid, setGrid] = useState([]);

  useEffect(() => {
    console.log('App useEffect: initializing grid');   // should appear in DevTools console
    const rows = 10, cols = 10;
    const initial = Array.from({ length: rows }, (_, r) =>
      Array.from({ length: cols }, (_, c) => ({ row: r, col: c, isWall: false }))
    );
    setGrid(initial);
  }, []);

  return (
    <div className="App">
      {grid.length ? (
        <Grid grid={grid} />
      ) : (
        <p>Initializing gridâ€¦</p>
      )}
    </div>
  );
}
